import React from 'react';

function Portfolio() {
  return (

    <>

      <div>
        <a href='https://github.com/salvo-t/Note-Taker'> <img src={require('../../assets/cover/note.png')} ></img> </a>
        <p>This is my note taker app made deployed with heroku</p>
      </div>

      <div>
        <a href='https://github.com/salvo-t/Text-editor'> <img src={require('../../assets/cover/jate.png')} alt=''></img></a>
        <p>This is my text editor made with PWA</p>
      </div>

      <div>
        <a href='https://github.com/salvo-t/E-commerce-back-end'><img src={require('../../assets/cover/backend.png')} alt=''></img></a>
        <p>This is my ecommerce backened using insomnia</p>
      </div>

    </>

  )
};

export default Portfolio;
